import React from 'react'
import {mdx} from '@mdx-js/react'

/* @jsxRuntime classic */
/* @jsx mdx */
/* @jsxFrag mdx.Fragment */
const makeShortcode = name => props => {
  console.warn("Component `%s` was not imported, exported, or provided by MDXProvider as global scope", name);
  return <>{props.children}</>;
};
const PageSection = makeShortcode("PageSection");
export const frontMatter = {
  "title": "A blogentry",
  "timeToRead": "1 min read"
};
export const headings = [{
  "title": ["Du finner oss på Aqua Nor!"]
}];
const MDXLayout = "wrapper";
function MDXContent({components, ...props}) {
  return <MDXLayout components={components} {...props}><PageSection title="Du finner oss på Aqua Nor!" className="wrapper " mdxType="PageSection"><article className="content" parentName="PageSection"><div className="content__heading" parentName="article"><h1 className="md:text-700" parentName="div"><span parentName="h1">{"A blogentry"}</span>{" "}</h1></div><div className="content__content_wide flow-space-400 flow" parentName="article"><p parentName="div">{"A blogentry"}</p></div><div className="content__media" parentName="article" /></article></PageSection></MDXLayout>;
}
MDXContent.isMDXComponent = true;
export default MDXContent;
